import React from 'react';

import Select from 'react-select';

const colourOptions = {
  admin_primry_color: '#373948',
  primary_text_color: 'white',
  body_color: '#DDE1E3',
  form_label_fontsize: '13px',
}
export default () => (
  <Select
    isMulti
    name="colors"
    options={colourOptions}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
